import React from "react";
import styles from "../styles/Sidebar.module.css";
import { useSelector } from "react-redux";
function Sidebar() {
  const showSidebar = useSelector((state) => state.meta.showSidebar);
  return (
    <div
      className={
        showSidebar ? { ...styles.container } : { ...styles.container_hide }
      }
    ></div>
  );
}

export default Sidebar;
